import { useEffect, useState } from "react"
import { Todo } from "./Todo"
import './styles.css'

export const Todos = () => {
    const [data, setData] = useState([])

    const fatchTodos = async() => {
        const fetchedData = await fetch('https://jsonplaceholder.typicode.com/todos'/* , {
            method: "GET" 
        } */)
        const parsedData = await fetchedData.json()
        setData(parsedData.slice(0, 15))
    }

    const todos = data.length ? data.map((d) =>  <Todo key={d.id} d={d} data={data} setData={setData}/> ): 'loading'

    useEffect(() => {
        fatchTodos()
    }, [])

    return(
        <div className="todos">
            {todos}
        </div>
    )
}
